using System.Linq;
using System.Text;
using Xunit;

namespace LeecodeChallenges.Test
{
    public class Solution_00006_ZConvertTest
    {
        Solution_00006_ZConvert obj = new Solution_00006_ZConvert();
        [Fact]
        public void case_01()
        {
            var result = obj.Convert("23", 1);
            Assert.Equal("23", result);
        }

        [Fact]
        public void case_02()
        {
            var result = obj.Convert("23", 2);
            Assert.Equal("23", result);
        }

        [Fact]
        public void case_03()
        {
            var result = obj.Convert("234", 1);
            Assert.Equal("234", result);
        }

        [Fact]
        public void case_04()
        {
            var result = obj.Convert("234", 2);
            Assert.Equal("243", result);
        }

        [Fact]
        public void case_05()
        {
            var result = obj.Convert("234", 3);
            Assert.Equal("234", result);
        }

        [Fact]
        public void case_06()
        {
            var result = obj.Convert("234", 10);
            Assert.Equal("234", result);
        }

        [Fact]
        public void case_12()
        {
            var result = obj.Convert("LEETCODEISHIRING", 3);
            Assert.Equal("LCIRETOESIIGEDHN", result);
        }

        [Fact]
        public void case_13()
        {
            var result = obj.Convert("LEETCODEISHIRING", 4);
            Assert.Equal("LDREOEIIECIHNTSG", result);
        }
        [Fact]
        public void case_999()
        {
            var result = obj.Convert("", 4);
            Assert.Equal("", result);
        }

    }
}